commits.content:
.market-container {
    display: flex;
    justify-content: center;
    margin: 40px 0;
}

.market-circle {
    width: 300px;
    height: 300px;
    border-radius: 50%;
    background: linear-gradient(135deg, var(--primary-color), var(--secondary-color));
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    color: white;
    padding: 20px;
}

.market-value {
    font-size: 36px;
    font-weight: bold;
    margin: 10px 0;
}
